import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";

import "./styles.css";
import "./index.css"
// import required modules
import { Pagination } from "swiper";

export default function App() {
  return (

    <><div className="h-[250px] bg-black">

    </div>
    <div>

    </div>
    <div  className="bg-lavander h-[600px] w-[390px] ">
      <Swiper
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        slidesPerView={1.25}
        spaceBetween={24}
        centeredSlides={true}
        className="mySwiper"

      >
      <></>
        <SwiperSlide className="bg-lavander">
          <div className="w-[304.06px] h-[349px] bg-white rounded-[30px] mt-[-80px]">
            slide 1
          </div>
        </SwiperSlide>

        <SwiperSlide className="bg-lavander">
        <div className="w-[304.06px] h-[349px] bg-white rounded-[30px]">
            slide 2
          </div>
        </SwiperSlide >
        <SwiperSlide className="bg-lavander" >
        <div className="w-[304.06px] h-[349px] bg-white rounded-[30px]">
            slide 3
          </div>
        </SwiperSlide>
        <SwiperSlide className="bg-lavander" >
        <div className="w-[304.06px] h-[349px] bg-white rounded-[30px]">
            slide 4
          </div>
        </SwiperSlide>

      </Swiper>
      </div>
    </>
  );
}
